import React from 'react';
import TeamSectionWrapper from './team.style';
import { Container, Row, Col } from "reusecore/Layout";
import Box from "reusecore/Box";
import Heading from "reusecore/Heading";
import Text from "reusecore/Text";
import Image from "reusecore/Image";

import name1 from 'assets/images/team/1.jpeg'
import name2 from 'assets/images/team/2.jpeg'
import name3 from 'assets/images/team/3.jpeg'
import name4 from 'assets/images/team/4.jpeg'


const Team = () => {
  return (
    <TeamSectionWrapper>
       <Container>
        <Row>
          <Col className="md-12">
            <Box className="service-item-wrapper">
              <Row>
                {data.services.map((service, index) => (
                  <Col className="lg-3 sm-6 xs-12" key={index}>
                    <Box className="service-item text-center">
                      <Image src={service.icon} alt="Lama service icon" />
                      <Heading as="h3">{service.title}</Heading>
                      <Text>{service.body}</Text>
                    </Box>
                  </Col>
                ))}
              </Row>
            </Box>
          </Col>
        </Row>
      </Container>
    </TeamSectionWrapper>

  );
}

export default Team;
